import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css'; // You can create this file for basic styling or remove this line if not needed.
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
